import React, { Component } from 'react';
import './App.css';

class App extends Component {

  constructor(){
    super();

    this.state = {
      monsters : ["rafi"],
      names: ['a']
    }
  }



  render () {
    return (
      <div className="App">
        <header className="App-header">
          {this.state.monsters[0].map((monster, index) => (<h1> {this.state.monster} </h1>))}
          <h1>hello</h1>
        </header>
      </div>
    );
  }
}

export default App;
